import React from "react";
import "./Weather.css";
import cloudy from "./WeatherLogo/cloudy.png";
import fullcloud from "./WeatherLogo/fullcloud.png";
import rainy from "./WeatherLogo/rainy.png";
import storm from "./WeatherLogo/storm.png";
import sunny from "./WeatherLogo/sunny.png";

function Weather(props) {
  const findLogo = (min, max) => {
    if (min > 30 && max < 40) {
      //30-40 sunny
      return sunny;
    } else if (min > 25 && max < 35) {
      //25-35 cloudy
      return cloudy;
    } else if (min > 15 && max < 25) {
      //15-25 cloudy
      return fullcloud;
    } else if (min > 10 && max < 15) {
      //10-15 cloudy
      return rainy;
    } else if (min > -5 && max < 10) {
      //25-35 cloudy
      return storm;
    }
  };

  return (
    <div className="weather">
      <h3 className="header">{props.day}</h3>
      <img
        className="weatherlogo"
        src={findLogo(props.high, props.low)}
        alt="WeatherLogo"
      />
      <div className="highlow">
        <h3 className="high">{props.high}</h3>
        <h3 className="low">{props.low}</h3>
      </div>
    </div>
  );
}

export default Weather;
